import './App.css';
import React from 'react';
import Eventos from './components/Eventos/Eventos';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Eventos />} />
      </Routes>
    </BrowserRouter>
  )
}

export default App;
